	$('body').on('click', '.comment-submit', function() {
		let eleBtn = $(this);
		let parentHolder = $(this).parents('.comment-form-wrapper').eq(0);
		let commentData = JSON.stringify($('.comment_input .ql-editor', parentHolder).html());
		
		commentData = commentData.replace(/&#(\d+);/g, function(match, dec) {
			return String.fromCharCode(dec);
		});
		
		$('.-error-text', parentHolder).addClass('-hidden');
		$('.-error-text', parentHolder).html('');
		loadLoader($('.commentcontenthold', parentHolder));		
		$.post('/comments/comments/add_ajax', {
			'ref': $('.commentRef', parentHolder).val(),
			'ref_id': $('.commentRefId', parentHolder).val(),
			'parent_id': $('.commentParentId', parentHolder).val(),
			'id': $('.commentId', parentHolder).val(),
			'ajx_refresh': $('.commentAjxRefresh', parentHolder).val(),
			'content': commentData
			}, function(r) {
				if (typeof(r.data) !== 'undefined') {
					if (typeof(r.data.comment) !== 'undefined') {
						$('.comment_input .ql-editor', parentHolder).html('');
						if (typeof(r.data.comment_html) !== 'undefined') {
							let wrapper = parentHolder.parents('.ent-comments').eq(0);
							
							if (parseInt($('.commentId', parentHolder).val()) > 0) {
								let currentEle = $('#itemcomment' + r.data.comment.id, wrapper);
								currentEle.replaceWith(r.data.comment_html);
//								$('.ent-comments-list', wrapper).append(r.data.comment_html);
//								$('#itemcomment' + r.data.comment.id, '.ent-comments-list').html(r.data.comment_html);
							} else {
								$('.ent-comments-list', wrapper).append(r.data.comment_html);	
							}
							
							
							insertCommentFlag($('#itemcomment' + r.data.comment.id + ' .cmt_rp_flag'));
							insertCommentEdit($('#itemcomment' + r.data.comment.id + ' .cmt_rp_edit'));
							insertCommentDelete($('#itemcomment' + r.data.comment.id + ' .cmt_rp_remove'));
							$('#itemcomment' + r.data.comment.id + ' .timeago').timeago();
							$('#itemcomment' + r.data.comment.id + ' .timeago').show();
							commentCancelReply($('#itemcomment' + r.data.comment.id));
							$('.commentId', parentHolder).val('');
							
							eleBtn.text(eleBtn.data('text'));
						} else {
							location.reload();	
						}
//						
					} else {
						$('.-error-text', parentHolder).html('Eroare de sistem. Ne cerem scuze. Va rugam reincercati');
						$('.-error-text', parentHolder).removeClass('-hidden');
					}
				} else if (typeof(r.errors_text) !== 'undefined') {
					$('.-error-text', parentHolder).html('Aveti urmatoarele erori:<br/>' +r.errors_text);
					$('.-error-text', parentHolder).removeClass('-hidden');
				}
				removeLoader($('.commentcontenthold', parentHolder));
			}
		).fail(function(e) {
			if (e.status == 413) {
				$('.-error-text', parentHolder).html('Comentariu depaseste limita maxima de marime. (posibil sa aveti imagini prea mari)');
			} else {
				$('.-error-text', parentHolder).html('Eroare de sistem. Ne cerem scuze. Va rugam reincercati mai tarziu');
			}
			$('.-error-text', parentHolder).removeClass('-hidden');
			removeLoader($('.commentcontenthold'));
		});
		
		return false;
	});
	
	$('body').on('click', '.comment-item-content .comareply', function() {
		let username = $(this).data('username');
		let commentID = $(this).data('comment-id');
		let parentPost = $(this).parents('.ent-comments').eq(0);
		let parent = $(this).parents('.comment-item-inner').eq(0);
		$('.-error-text', $('.comment-form-wrapper', parentPost)).addClass('-hidden');
		$('.-error-text', $('.comment-form-wrapper', parentPost)).html('');
		$('.replymeta-show', parentPost).html('Raspunzi la comentariu lui ' + username + ' <a class="cancelreply" style="float:right;" href="javascript:;"><strong>Anuleaza</strong></a>');
		$('.comment-form-wrapper .commentParentId', parentPost).val(commentID);
		
		$('.comment-form-wrapper', parentPost).insertAfter(parent);
		
		$('.comment-form-wrapper', parentPost)[0].scrollIntoView({ 
			  behavior: 'smooth',
			  block: 'center'
			});
		return false;
	});
	
	$('body').on('click', '.comment-item-content .cmt_rp_remove', function() {
		let ele = $(this);
		let theComment = ele.parents('.comment-item-inner').eq(0);
		let theCommentInner = $('.comment-item-content', theComment);
		let commentId = ele.data('cid');
		let ctype = $(this).data('ctype');
		if (confirm('\nSunteti siguri ca vreti sa stergeti acest comentariu ?\nProcesul nu e reversabil.\nToate raspunsurile facute de utilizatori la acest comentariu vor fi sterse.')) {
			loadLoader(theCommentInner);
			$('.comment_err_wr', theCommentInner).remove();
			$.post('/comments/comments/delete', {'id': commentId, 'ref': ctype}, function(r) {
				if (typeof(r.data) !== 'undefined') {
					if (typeof(r.data.comment) !== 'undefined') {
						theComment.remove();
////						if (typeof(r.data.redirect) !== 'undefined') {
////							window.location = response.data.redirect;
////						} else {
////							location.reload();
////						}
//						
//						if (typeof(rulr) !== 'undefined' && rulr.length > 0) {
//							window.location = rulr;
//						} else {
//							postDrops[pId].remove();
//							parentEle.remove();
//						}
					} else {
						theCommentInner.addClass('box--banner-err');
						showCommentErr(theCommentInner, 'Eroare de sistem. Ne cerem scuze. Va rugam reincercati mai tarziu.');
					}
				} else if (typeof(r.errors_text) !== 'undefined') {
					theCommentInner.addClass('box--banner-err');
					showCommentErr(theCommentInner, r.errors_text);
				}
				removeLoader(theComment);
			}).fail(function(e) {
				theCommentInner.addClass('box--banner-err');
				showPostErr(theCommentInner, 'Eroare de sistem. Ne cerem scuze. Va rugam reincercati mai tarziu.');
				removeLoader(theCommentInner);
			});
		}
		
	});
	
	
